import type { Meta, StoryObj } from "@storybook/react";
import { Message } from "./Message";
const meta: Meta<typeof Message> = {
  title: "Message",
  component: Message
};
export default meta;
type MessageType = StoryObj<typeof meta>;
export const NewMessage: MessageType = {
  args: {
    message: 'Hi Hi'
  }
};
NewMessage.parameters = {
  ...NewMessage.parameters,
  docs: {
    ...NewMessage.parameters?.docs,
    source: {
      originalSource: "{\n  args: {\n    message: 'Hi Hi'\n  }\n}",
      ...NewMessage.parameters?.docs?.source
    }
